import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Add = () => {
  const [patient, setPatient] = useState('');
  const [lab, setLab] = useState('');
  const [report, setReport] = useState('');
  const [date, setDate] = useState('');
  const [patientList, setPatientList] = useState([]);
  const [labList, setLabList] = useState([]);

  useEffect(() => {
    const getPatientList = async () => {
      const res = await axios.get('http://localhost:5005/api/patients');
      setPatientList(res.data);
    };

    const getLabList = async () => {
      const res = await axios.get('http://localhost:5005/api/labs');
      setLabList(res.data);
    };

    getPatientList();
    getLabList();
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    // try {
    //   const res = await axios.post('http://localhost:5005/api/labs', {
    //     name: name,
    //     address: address,
    //     email: email,
    //     phone: phone,
    //     headers: {
    //       'Content-Type': 'application/json',
    //     },
    //   });
    //   console.log(res.data);
    //   console.log('NEW Lab ADDED');
    // } catch (error) {
    //   console.log(error);
    // }
  };

  return (
    <form className='create' onSubmit={handleSubmit}>
      <h3> Add a New Lab</h3>
      <label htmlFor=''>Patient: </label>
      <select
        name=''
        id='gender'
        value={patient}
        onChange={(e) => setPatient(e.target.value)}
      >
        {patientList.map((patient, idx) => {
          return (
            <option key={patient._id} value={patient._id}>
              {patient.firstName} + ' '' + {patient.lastName}{' '}
            </option>
          );
        })}
        <option value='Male'>Male</option>
        <option value='Female'>Female</option>
        <option value='Other'>Other</option>
      </select>
      <br />
      <label htmlFor=''>Lab: </label>
      <input
        type='text'
        onChange={(e) => setLab(e.target.value)}
        value={lab}
      />{' '}
      <br />
      <label htmlFor=''>Report </label>
      <input
        type='text'
        onChange={(e) => setReport(e.target.value)}
        value={report}
      />
      <br />
      <label htmlFor=''>Date: </label>
      <input
        type='email'
        onChange={(e) => setDate(e.target.value)}
        value={date}
      />
      <br />
      <button> Add Patient Lab Report</button>
    </form>
  );
};

export default Add;
